After examining the three possible S‐productions,

  1. S → NT5 NT28  
  2. S → NT8 NT28  
  3. S → NT14 NT5  

we see that the first terminal of any string derived by  
– NT5 is one of {t19,t36,t40,t43,t45,t48,t49,t54,t63,t69,t74,t77, …}  
– NT8 is one of {t15,t43,t68}  
– NT14 is one of {t36,t74,t80}  

None of these sets contains t53, yet the target string begins with t53.  Hence no derivation from S can produce a string starting with t53.  

